import React, {useState} from "react"
import Note from "./components/Note";

const App = () => {
    const [state, setState] = useState([
        {
            width: 200,
            height: 200,
            x: 0,
            y: 0
        },
        {
            width: 200,
            height: 200,
            x: 0,
            y: 0
        }
    ]);

    return (
        <div style={{backgroundColor: "aqua", width: "100vw", height: '100vh'}}>
            {
                state.map((note, index) => {
                        return (
                            <Note key={index}
                                  index={index}
                                  state={state}
                                  setState={setState}
                            />
                        )
                    }
                )
            }
        </div>
    )
}


export default App
